window.bookSummaryJSON = "<p><b>She betrayed them and ran away. Now they want their revenge.</b></p> <p>In a town where all that matters is loyalty to your gang, I've been labeled a traitor.</p> <p>A death sentence.</p> <p>I ran away from the North Shore the day I knew I wasn't safe there anymore. I left behind the people I thought were my family: My crew, the Kings.</p> <p>More importantly, I turned my back on the two men who once meant everything to me.</p> <p>The hardest thing I've ever done.</p> <p>I might have known Elliot and Ethan since we were children, but I betrayed the brothers in more ways than one.</p> <p>Now they want me dead.</p> <p>I should have known no one escapes the Kings. They found me and are taking me back to face my darkest secrets and most haunting memories.</p> <p>A place where I am public enemy number one.</p> <p>I'm stuck with a master manipulator and his bloodthirsty brother. Two men who only want to make me hurt. In more ways than one.</p> <p>They will never let me go. At least not until I've paid for my sins.</p> <p><i>A dark and sizzling, enemies to lovers, polyamorous standalone romance from bestselling author, Lola King.</i> Delightful Sins <i>is the third book in the North Shore Stories. It can be listened to as a standalone. For mature listeners.</i></p>"; 
